const React = require('react');
const ReactDOM = require('react-dom');
const client = require('./client');

class App extends React.Component {

	constructor(props) {
		super(props);
		this.state = {cardTypes: []};
	}

	componentDidMount() {
		client({method: 'GET', path: '/db/cardTypes'}).done(response => {
			this.setState({cardTypes: response.entity._embedded.cardTypes});
		});
	}

	render() {
		return (
			<CardTypeList types={this.state.cardTypes} />
		)
	}
}

class CardTypeList extends React.Component{
	render() {
		const types = this.props.cardTypes.map(cardType => 
			<CardType key={cardType._links.self.href} cardType={cardType}/>
			);
			return(
			<table>
				<tbody>
					<tr>
						<th>Id</th>
						<th>Title</th>
						<th>Description</th>
					</tr>
					{cardTypes}
				</tbody>
			</table>
			)
	}
}

class CardType extends React.Component{
	render() {
		return (
			<tr>
				<td>{this.props.cardType.id}</td>
			</tr>
			)
	}	
}

ReactDOM.render(
	<App />,
	document.getElementById('react')
	)
